export function getEmojiBySlug(slug: string, locale: string): Emoji | undefined {
  return emojiData.find(emoji => emoji.slug[locale as keyof typeof emoji.slug] === slug);
}

export function getEmojisByCategory(category: string): Emoji[] {
  return emojiData.filter(emoji => emoji.category === category);
}

export function searchEmojis(query: string, locale: string): Emoji[] {
  const lowerQuery = query.toLowerCase();
  return emojiData.filter(emoji => 
    emoji.name[locale as keyof typeof emoji.name].toLowerCase().includes(lowerQuery) ||
    emoji.keywords[locale as keyof typeof emoji.keywords].some(keyword => 
      keyword.toLowerCase().includes(lowerQuery)
    ) ||
    emoji.emoji.includes(lowerQuery)
  );
}

export function getAllEmojis(): Emoji[] {
  return emojiData;
}
